const { response } = require("express");
const exp = require("express");
const app = exp();
const givelocalstays = exp.Router();
const localStaymodel = require("../Model/localStay");
givelocalstays
.post("/",async (req,res)=>{
    try{
        // console.log(req.body)
       await localStaymodel.find({StateName:req.body.StateName,distName:req.body.distName}).then((response)=>{
            if(response.length===0){
                res.send([
                    {
                        StateName: "BIHAR",
                        distName: "MADHUBANI",
                        userName: "Alok",
                        Rent: "1000 for 2 nights",
                        Rating: "8.7",
                        ContactNumber: "9211644200",
                        PictureKitchen: "data:image/jpeg;base64,",
                        PictureBedroom: "data:image/jpeg;base64,","PictureBathroom":"data:image/jpeg;base64,"
                    }
                ]);
            }
            else{
                res.send(response)
            }
       })
    }
    catch{
        res.send(
            [
                {
                    StateName: "BIHAR",
                    distName: "MADHUBANI",
                    userName: "Alok",
                    Rent: "1000 for 2 nights",
                    Rating: "8.7",
                    ContactNumber: "9211644200",
                    PictureKitchen: "data:image/jpeg;base64,",
                    PictureBedroom: "data:image/jpeg;base64,","PictureBathroom":"data:image/jpeg;base64,"
                }
            ]
        );
        return;
    }
})
module.exports=givelocalstays